import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="Feed">
      <Navbar />
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src="/images/navbar-logo.png" alt="navbar logo"></img>
      </div>
    )
  }
}

export default App;
